      incorporates by reference Form 99 Miscellaneous Report,  June 20, 2009, outlining
      its policies with regard to payments received by candidate committees for goods
      and services  provided. The Republican Party of Iowa owns and operates its own
      building and land at its headquarters in Des  Moines, Iowa. This committee does
      not recognize registered lobbyists or registrant committees for purposes of  aggregate
      contributions. The Republican Party of Iowa follows a best efforts policy/procedure
      that begins with a clean  and conspicuous request from donors for their full
      name, mailing address, occupation, and name of employer at the  initial solicitation
      for a contribution, informing the contributor of the requirements of federal
      law for the reporting of such  information, as required by under 11 CFR 104.7.
      Upon receipt of a contribution, collected donor information, as  reported by
      the donor, is captured into our contributor database for purposes of reporting
      on the next FEC disclosure  report. All contributors who have crossed the $200
      cumulative threshold and have not provided sufficient information  are sent
      correspondence requesting the missing information (that does not include a solicitation
      of contribution),  including a postage-paid return envelope. This is completed
      on a twice monthly basis. If information is still missing at  the time of a
      reporting cutoff, a phone contact is made. A record of the correspondence is
      documented and retained  for verification. Every effort is made to never have
      missing information on each disclosure report before filing;  however, when
      information is received following a filing, amendments of the original report
      or memo entries on  subsequent reports are submitted.
